// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

contract List {

    uint []data;
    uint current;

    constructor () public{
        current = 0;
    }

    function add(uint v) public {
        data[current] = v;
    }

    function deleteAtPosition(uint pos) public{
        //delete data[pos];
        uint [] memory newData = new uint[](data.length - 1);

        uint i = 0;
        for (; i < pos; i++){
            newData[i] = data[i];
        }

        for(i + 1; i< data.length; i++){
            newData[i] = data[i];
        }

        data = newData;
     }

    function getData() public returns(uint [] memory){
        return data;
    }

}
